import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl, { waitUntil: 'domcontentloaded' });

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Add a product to cart first
    await page.waitForSelector('.product-card', { timeout: 5000 });
    const addToCartBtn = await page.$('.product-card .add-to-cart');
    await addToCartBtn.click();

    // Wait for cart update and open cart
    await page.waitForTimeout(1000); // Brief pause for cart update
    await page.waitForSelector('.cart', { timeout: 5000 });
    await page.click('.cart');

    // Wait for cart modal to appear
    await page.waitForSelector('#cartModal', { timeout: 5000, state: 'visible' });

    // Take screenshot after opening cart
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_opened.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_opened.png'));

    // Update quantity using the plus button
    await page.waitForSelector('.cart-item .quantity-btn:last-child', { timeout: 5000 });
    const plusButton = await page.$('.cart-item .quantity-btn:last-child');
    await plusButton.click();

    // Wait for quantity update and take final screenshot
    await page.waitForTimeout(1000);
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_quantity_updated.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_quantity_updated.png'));

    // Extract updated quantity and total
    const quantity = await page.$eval('.cart-item .quantity', el => el.textContent);
    const total = await page.$eval('#cartTotal', el => el.textContent);

    return {
      success: true,
      action: "Updated cart item quantity from 1 to 2",
      extractedData: {
        quantity: quantity,
        total: total
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to update cart item quantity",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
